CREATE DEFINER=`crm_lead_mangement`@`localhost` PROCEDURE `GetLeadStatusCount` (IN `TeamId` INT, IN `ProjectId` INT)  NO SQL
SELECT * FROM 
    (SELECT count(lead_status) as RawLeads
    FROM leads
    WHERE ((lead_status = 0 AND lead_hidden_status=0) AND project_info_id=ProjectId)  AND CASE WHEN TeamID>0 THEN TeamMemeberAccessId=TeamID ELSE TRUE END ) AS TAB_1, 
    ( SELECT count(lead_status)as ColdLeads
    FROM leads
   WHERE  ((lead_status = 1 AND lead_hidden_status=0) AND project_info_id=ProjectId) AND CASE WHEN TeamID>0 THEN TeamMemeberAccessId=TeamID ELSE TRUE END ) AS TAB_2,
    (SELECT count(lead_status) as WarmLeads
    FROM leads
    WHERE  ((lead_status = 2 AND lead_hidden_status=0) AND project_info_id=ProjectId) AND CASE WHEN TeamID>0 THEN TeamMemeberAccessId=TeamID ELSE TRUE END ) AS TAB_3, 
    ( SELECT count(lead_status)as HotLeads
    FROM leads
    WHERE  ((lead_status = 3 AND lead_hidden_status=0) AND project_info_id=ProjectId) AND CASE WHEN TeamID>0 THEN TeamMemeberAccessId=TeamID ELSE TRUE END ) AS TAB_4,
    ( SELECT count(lead_status)as NonReleventLeads
    FROM leads
    WHERE  ((lead_status = 4 AND lead_hidden_status=0) AND project_info_id=ProjectId) AND CASE WHEN TeamID>0 THEN TeamMemeberAccessId=TeamID ELSE TRUE END ) AS TAB_5$$

CREATE DEFINER=`crm_lead_mangement`@`localhost` PROCEDURE `GetLeadStatusCountAdmin` (IN `TeamId` INT)  NO SQL
SELECT * FROM (SELECT count(lead_status) as RawLeads FROM leads WHERE ((lead_status = 0 AND lead_hidden_status=0) ) AND CASE WHEN 0>0 THEN TeamMemeberAccessId=0 ELSE TRUE END ) AS TAB_1, ( SELECT count(lead_status)as ColdLeads FROM leads WHERE ((lead_status = 1 AND lead_hidden_status=0) ) AND CASE WHEN TeamId>0 THEN TeamMemeberAccessId=0 ELSE TRUE END ) AS TAB_2, (SELECT count(lead_status) as WarmLeads FROM leads WHERE ((lead_status = 2 AND lead_hidden_status=0) ) AND CASE WHEN TeamId>0 THEN TeamMemeberAccessId=0 ELSE TRUE END ) AS TAB_3, ( SELECT count(lead_status)as HotLeads FROM leads WHERE ((lead_status = 3 AND lead_hidden_status=0) ) AND CASE WHEN TeamId>0 THEN TeamMemeberAccessId=0 ELSE TRUE END ) AS TAB_4, ( SELECT count(lead_status)as NonReleventLeads FROM leads WHERE ((lead_status = 4 AND lead_hidden_status=0) ) AND CASE WHEN TeamId>0 THEN TeamMemeberAccessId=0 ELSE TRUE END ) AS TAB_5$$

