ELSEIF role_type =3 then 

update leads set team_member_access_id = (select team_member_id from client_team_sub_members where team_leader_id=member_id and team_member_id= assign_member_id) where id = lead_id  AND 1 = (select count(team_member_id) from client_team_sub_members where team_leader_id=member_id and team_member_id= assign_member_id);

