(143, 'DIVYANSH ONYX12', 'Divyansh Onyx welcomes you on the widest ever entry lane of Delhi-Meerut Expressway (16 Lane) and NH24 at Ghaziabad to its coming-soon 2/3/4BHK ultra-modern lifestyle', 'http://realstate.oasisproperty.in/projectmedia/project_media.php?id=245', 'http://realstate.oasisproperty.in/projectimg/logo.png', '2023-03-02 08:00:57', 0, 0, 40),
(249, 'testdemonewcresol', 'testdemopnecresol is good project', 'https://www.cresol.in/', 'http://cresol.in/images/logo_cresol.png', '2023-06-15 06:37:20', 0, 5, 74),
(250, 'Aero western green ', 'A group of passionate real estate professionals launched Aero Western Green, to provide the best investment opportunities in locations and for individuals with innovative concepts. With a group that collectively has over two decades of experience. The goal is to create projects that provide people with almost everything they could want.', 'https://housingdream.in/aero-western-green-near-jewar-airport/', 'https://housingdream.in/www.housingdream.in/images/header_logo.png', '2023-06-15 06:37:20', 0, 1, 38),
(251, 'bhutani city center', 'Bhutani Infra is a name to trust upon in the Real Estate Domain. Having a rich wealth of knowledge and expertise in Realty domain, they are well known among the customers. They are committed to giving their customers complete satisfaction while buying the house. While planning, every small detail has been taken care of with all the major amenities incorporated. They boast of a strong team of engineers and architects who are highly skilled and committed to building finest structures that offer dream homes to people. The company has taken special care to handle such issues with their state-of-the-art solutions especially meant for the same', 'https://www.housingdream.in/bhutani-city-center-sector-150-noida', 'https://www.housingdream.in/bhutani-city-center-sector-150-noida/assets/images/logo.png', '2023-06-15 06:37:20', 0, 1, 38),
(252, 'bhutani alphathum', 'Bhutani Alphathum was introduced by the developers of Corenthum, i-thum, and World Square Mall in the prime location of Noida Sector 90. Alphathum has the most commercial space along Noida expressway. Market-leading 25-acre premium commercial property. Specifically, it consists of a Premium office complex, Retail complex, and a Studio apartment. This new generation industrial outing can have all the ingredients to become one in every of the country\'s best and unseen styles of work stations.', 'https://www.housingdream.in/bhutani-alphathum-sector-90-noida/', 'https://housingdream.in/www.housingdream.in/images/header_logo.png', '2023-06-15 06:37:20', 0, 1, 38),
(253, 'tata eureka park', 'Tata Eureka Park is strategically located at Sector 150, Pusta Road, with seamless connectivity to the main areas of Noida. Residential units at the project are available in the range of Rs. 63.9 lakhs - 1.21 crores. Spread over a sprawling area of 21 acres, this project is well-established. This residential complex has an attractive appearance that will appeal to most buyers. All units on the property are under construction. You can find your perfect sanctuary here, as the project offers several apartment configurations.', 'https://housingdream.in/tata-eureka-park-noida/', 'https://housingdream.in/www.housingdream.in/project/logo/tata-eureka-park.jpg', '2023-06-15 06:37:20', 0, 1, 38),
(254, 'godrej palm retreat', 'Located on Pusta Road, Noida Sector 150, the greenest area of Noida, Godrej Palm Retreat offers 430 \'Resort Residences\' for a select few. With world-class amenities at your disposal, immerse yourself in a lifestyle that will make you feel like you\'re on the vacation of a lifetime. Designed by Godrej Properties, one of the most trusted real estate brands, the project is under construction', 'https://housingdream.in/godrej-palm-retreat-noida/', 'https://housingdream.in/www.housingdream.in/project/logo/godrej-palm-retreat.jpg', '2023-06-15 06:37:20', 0, 1, 38),
(255, 'ats pristine golf villas', 'ATS Pristine Golf Villas is a strategically located Sector 150, Pusta Road in the city of Noida, and is a well-planned project. The affordable prices of the residential units in the Premium ATS Pristine Golf Villas Sector 150 Noida project are within the range of Rs. 4.50 cr - 7.0 cr. It covers an area of 24 acres, providing ample green space for residents. The project has a total of 114 units, which have been built with the robust build quality. This is a superbly designed residential property that is sure to impress. All units on the property are under construction.', 'https://housingdream.in/ats-pristine-golf-villas-noida/', 'https://housingdream.in/www.housingdream.in/project/logo/ats-pristine-golf-villas.jpg', '2023-06-15 06:37:20', 0, 1, 38),
(256, 'godrej nurture', 'Godrej Nurture in Sector-150, one of the upcoming under-construction housing societies in Noida. There are apartments for sale in the project. This society will have all the basic facilities and amenities to suit homebuyers needs and requirements. Brought to you by Godrej Properties, It is scheduled for possession in Sep 2025. Godrej Properties is one of the known real estate brands in Noida.', 'https://housingdream.in/godrej-nurture-noida/', 'https://housingdream.in/www.housingdream.in/project/logo/godrej-nurture.jpg', '2023-06-15 06:37:20', 0, 1, 38),
